&gt;&lt;span style=\\&quot;font-size: large; \\&quot;&gt;Jonathan Apples&lt;/span&gt;&lt;/strong&gt;&lt;span style=\\&quot;font-size: small; \\&quot;&gt;&lt;span style=\\&quot;letter-spacing: 0px; \\&quot;&gt;&amp;nbsp;&lt;img width=\\&quot;200\\&quot; height=\\&quot;158\\&quot; vspace=\\&quot;10\\&quot; hspace=\\&quot;10\\&quot; align=\\&quot;right\\&quot; alt=\\&quot;\\&quot; src=\\&quot;/userfiles/jonathanapples.jpg\\&quot; /&gt;&lt;/span&gt;&lt;/span&gt;&lt;span style=\\&quot;font-size: small; \\&quot;&gt;&lt;span style=\\&quot;letter-spacing: 0px; \\&quot;&gt;&lt;br /&gt;\r\n&lt;br /&gt;\r\nJonathan apples are on their last legs!&lt;br /&gt;\r\n&lt;br /&gt;\r\nAs predicted three weeks ago price has continued to ease on Jonathan apples. &amp;nbsp;Over the weekend and next week expect prices to be back by around 10% in comparison to last week, depending upon size and quality. Volumes have gained serious momentum on market floors around the country and therefor price has come back. Jonathan apples are rapidly coming to the end of their season, so now is the time to indulge.&lt;br /&gt;\r\n&lt;br /&gt;\r\nGood quality Jonathans are firm with a smooth, clean, glossy red skin. They should be crisp to the bite and flavour is generally delicious and refreshing.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;div&gt;&lt;span style=\\&quot;letter-spacing: 0.0px\\&quot;&gt;&lt;br /&gt;\r\n&lt;/span&gt;&lt;/div&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;p style=\\&quot;margin: 0.0px 0.0px 34.0px 0.0px; font: 16.0px Calibri; color: #393939\\&quot;&gt;&lt;span style=\\&quot;font-size: large; \\&quot;&gt;&lt;strong&gt;Cabbage&lt;/strong&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p style=\\&quot;margin: 0.0px 0.0px 34.0px 0.0px; font: 16.0px Calibri; color: #393939\\&quot;&gt;&lt;span style=\\&quot;font-size: small; \\&quot;&gt;&lt;span style=\\&quot;letter-spacing: 0px; \\&quot;&gt;Cabbage market is still on the move!&lt;br /&gt;\r\n&lt;/span&gt;&lt;span style=\\&quot;letter-spacing: 0px; \\&quot;&gt;&lt;br /&gt;\r\nThe quality of cabbages in general at this time of year is first class. As predicted three weeks ago Cabbage price has continued to move up by as much as 20%. Over the coming weekend and next week cabbage will again increase in price by as much as 20%, depending upon size and quality. The colder weather across the country has affected every state&amp;rsquo;s regional growing area, which in-turn has slowed &lt;img width=\\&quot;226\\&quot; height=\\&quot;161\\&quot; vspace=\\&quot;10\\&quot; hspace=\\&quot;10\\&quot; align=\\&quot;left\\&quot; alt=\\&quot;\\&quot; src=\\&quot;/userfiles/Cabbage.jpeg\\&quot; /&gt;the growth rate of cabbages. Less volumes across the country coupled with the increased consumer demand due to the cooler weather means the high cabbage price is going to hold.&lt;br /&gt;\r\n&lt;/span&gt;&lt;span style=\\&quot;letter-spacing: 0px; \\&quot;&gt;&lt;br /&gt;\r\nCabbages should feel slightly heavy for their size. Savoy cabbage should have crinkly, crisp green leaves.&amp;nbsp; Green and red cabbages should have shiny, compact leaves.&lt;br /&gt;\r\n&lt;/span&gt;&lt;span style=\\&quot;letter-spacing: 0px; \\&quot;&gt;&lt;br /&gt;\r\nIn many dishes, such as salads, soups and casseroles, cabbage is prepared by cutting it into quarters and removing the hard core in the centre. The leaves are then chopped or finely shredded. Overcooking cabbage can intensify its strong odour -- instead, lightly saute, boil or stir-fry it to achieve best results. Cabbage goes well with lots of things, here&amp;rsquo;s a start: apples, chicken, beef, blue cheese, bacon, caraway seeds, coriander, duck, feta, garlic, ham, mustard, olive oil, parmesan, pork and walnuts.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;div&gt;&amp;nbsp;&lt;/div&gt;\r\n&lt;div&gt;&lt;strong&gt;&lt;span style=\\&quot;font-size: large; \\&quot;&gt;Leeks&lt;/span&gt;&lt;/strong&gt;&lt;/div&gt;\r\n&lt;div&gt;&amp;nbsp;&lt;/div&gt;\r\n&lt;!--[if gte mso 9]&gt;&lt;xml&gt;\r