t;&lt;span lang=\\&quot;EN-US\\&quot;&gt;Prime-time for Leeks.&lt;br /&gt;\r\n&lt;br /&gt;\r\n&lt;/span&gt;&lt;img width=\\&quot;200\\&quot; height=\\&quot;153\\&quot; vspace=\\&quot;10\\&quot; hspace=\\&quot;10\\&quot; align=\\&quot;right\\&quot; alt=\\&quot;\\&quot; src=\\&quot;/userfiles/Leeks(2).jpeg\\&quot; /&gt; Leeks from South Australia and Victoria are coming into their peek for quality and quantity. Leeks have been holding steady as far as price is concerned for the past three weeks. Their current price point will remain unchanged over the next 7 days. You will find them very good buying over the next month at least.&amp;nbsp;Actually, be on the look-out your local fresh food retailer may even have leeks on special.&amp;nbsp;&lt;br /&gt;\r\n&lt;span lang=\\&quot;EN-US\\&quot;&gt;&lt;br /&gt;\r\nLeeks are an excellent source of vitamin C and dietary fibre. Look for leeks with crisp green tops. Cut and dispose of the dark green top of the leek. Cut lengthways and wash the remaining part of the leek, rinsing away any dirt. Only the thick white stem and the palest green part of the leek are edible. After the leek has been thoroughly washed cut crossways. Leeks can be added to casseroles and soups or saute until caramelised.&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;Body\\&quot; style=\\&quot;tab-stops:35.45pt 70.85pt 106.3pt 5.0cm 177.15pt 212.6pt 248.05pt 283.45pt 318.9pt 354.35pt 389.75pt 425.2pt 460.65pt\\&quot;&gt;&lt;span lang=\\&quot;EN-US\\&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\\&quot;Body\\&quot; style=\\&quot;tab-stops:35.45pt 70.85pt 106.3pt 5.0cm 177.15pt 212.6pt 248.05pt 283.45pt 318.9pt 354.35pt 389.75pt 425.2pt 460.65pt\\&quot;&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;p class=\\&quot;Body\\&quot; style=\\&quot;tab-stops:35.45pt 70.85pt 106.3pt 5.0cm 177.15pt 212.6pt 248.05pt 283.45pt 318.9pt 354.35pt 389.75pt 425.2pt 460.65pt\\&quot;&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;p class=\\&quot;Body\\&quot; style=\\&quot;tab-stops:35